    const cookies = new Cookies();
    const Navigate = useNavigate()

    console.log(cookies.get('jwt'))
    console.log(cookies.getAll())
    useEffect(()=>{
        console.log(cookies.get('jwt'))
        cookies.get('jwt') === undefined && Navigate('/seller/login')
    },[Navigate,cookies])
    return (
        <div>
            <Navbar/>
            <Content/>
        </div>
    )
}
